import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Card, CardBody,CardTitle,CardSubtitle,CardText,CardLink } from 'reactstrap';

function App() {
  return (
    <Card
      style={{
        width: '18rem',
        borderRadius: '20px'
      }}
      >
      <CardBody>
        <CardTitle tag="h5">
          Card title
        </CardTitle>
        <CardSubtitle
          className="mb-2 text-muted"
          tag="h6"
        >
          Card subtitle
        </CardSubtitle>
      </CardBody>
      <img
        alt="Card cap"
        src="https://picsum.photos/318/180"
        width="100%"
      />
      <CardBody>
        <CardText>
          Some quick example text to build on the card title and make up the bulk of the cardâ€˜s content.
        </CardText>
        <CardLink href="#">
          Card Link
        </CardLink>
        <CardLink href="#">
          Another Link
        </CardLink>
      </CardBody>
    </Card>
  );
}

export default App;
